import { AppBar } from "@material-ui/core";
import { Toolbar } from "@mui/material";

const Footer = () => {
  return (
    <>
      <Toolbar sx={{ borderBottom: "1px solid" }}></Toolbar>
      <Toolbar></Toolbar>
    </>
